<#
.SYNOPSIS
Url Gathering

.DESCRIPTION
Gather URL from Edge, Chrome and Firefox of all user of a Windows host.
You need administrative priviledge on the remote host.

.PARAMETER Hostfile
Remote Host (dnshostname)

.EXAMPLE
Invoke-UrlFinder -Rhost 192.168.1.10

.NOTES
Author: r1cksec
License: GNU General Public License
#>

Function Invoke-UrlFinder
{

    Param
    (
        [Parameter(Mandatory = $true)][string]$Rhost = ""
    )

    $Blob = ""

    if (! (Test-Path("C:\temp\sql89034z5")))
    {

        if (! (Test-Path("C:\temp")))
        {
            mkdir C:\temp
        }

        if (! (Test-Path("C:\temp\sql.zip")))
        {
            [IO.File]::WriteAllBytes("C:\temp\sql.zip", [Convert]::FromBase64String($Blob))
        }

        Expand-Archive -LiteralPath "C:\temp\sql.zip" -DestinationPath "C:\temp\sql89034z5"
    }

    $Users = ls \\$Rhost\C$\users
    
    foreach ($User in $Users)
    {
        echo "########### $User.name ##########"

        $allFireProfilesRoaming = ls \\$Rhost\C$\users\$User\AppData\Roaming\Mozilla\Firefox\Profiles -ErrorAction SilentlyContinue

        foreach ($profile in $allFireProfilesRoaming)
        {
            $FireCookie = "\\$Rhost\C$\users\$User\AppData\Roaming\Mozilla\Firefox\Profiles\$profile\cookies.sqlite"
            $FirePlace = "\\$Rhost\C$\users\$User\AppData\Roaming\Mozilla\Firefox\Profiles\$profile\places.sqlite"

            if (Test-Path -path $FireCookie)
            {
                echo "Firefox Cookies"
                C:\temp\sql89034z5\sql.exe $FireCookie -cmd "SELECT host FROM moz_cookies;" ".quit"
            }

            if (Test-Path -path $FirePlace)
            {
                echo "Firefox Places"
                C:\temp\sql89034z5\sql.exe $FirePlace -cmd "SELECT moz_places.url FROM moz_places, moz_historyvisits WHERE moz_places.id = moz_historyvisits.place_id;" ".quit"
            }
        }

        $allFireProfilesLocal = ls \\$Rhost\C$\users\$User\AppData\Local\Mozilla\Firefox\Profiles -ErrorAction SilentlyContinue

        foreach ($profile in $allFireProfilesLocal)
        {
            $FireCookie = "\\$Rhost\C$\users\$User\AppData\Local\Mozilla\Firefox\Profiles\$profile\cookies.sqlite"
            $FirePlace = "\\$Rhost\C$\users\$User\AppData\Local\Mozilla\Firefox\Profiles\$profile\places.sqlite"

            if (Test-Path -path $FireCookie)
            {
                echo "Firefox Cookies"
                C:\temp\sql89034z5\sql.exe $FireCookie -cmd "SELECT host FROM moz_cookies;" ".quit"
            }

            if (Test-Path -path $FirePlace)
            {
                echo "Firefox Places"
                C:\temp\sql89034z5\sql.exe $FirePlace -cmd "SELECT moz_places.url FROM moz_places, moz_historyvisits WHERE moz_places.id = moz_historyvisits.place_id;" ".quit"
            }
        }

        $ChromeHistory = "\\$Rhost\C$\users\$User\AppData\Local\Google\Chrome\User Data\Default\History"

        if (Test-Path -path $ChromeHistory)
        {
            echo "Chrome"
            C:\temp\sql89034z5\sql.exe $ChromeHistory -cmd "SELECT urls.url, urls.title FROM urls;" ".quit"
        }

        $EdgeHistory = "\\$Rhost\C$\users\$User\AppData\Local\Microsoft\Edge\User Data\Default\History"

        if (Test-Path -path $ChromeHistory)
        {
            echo "Edge"
            C:\temp\sql89034z5\sql.exe $EdgeHistory -cmd "SELECT url,title from urls;" ".quit"
        }
    }
}

